import React from 'react';
import Navbar from './Navbar/Navbar';  // Assurez-vous que le chemin est correct
import TransitionPage from './components/TransitionPage';
import { CardProvider, useCard } from './components/CardContext';

const MainContent = () => {
  const { selectedCard, isLottieVisible, finishAnimation, resetCard } = useCard();

  return (
    <div>
      <Navbar />  {/* Assurez-vous que Navbar est bien utilis√© ici */}

      {selectedCard && (
        <TransitionPage
          selectedCard={selectedCard}
          onComplete={finishAnimation}
          onBack={resetCard}
        />
      )}
    </div>
  );
};

const MainComponent = () => (
  <CardProvider>
    <MainContent />
  </CardProvider>
);

export default MainComponent;
